		const playlistId = 'PLqxc4-9rluJ8Ks1sNOzeOADYOJLCLzfiR';
		const num = 6;
		const url = `https://www.googleapis.com/youtube/v3/playlistItems?part=snippet&key=${key}&playlistId=${playlistId}&maxResults=${num}`;
	}, []);
	return (
		<Layout name={'Video'}>
			<p>Video</p>
		</Layout>
	);
}

export default Video;
